// components/Playlist/Playlist.js

import React from 'react';
import Song from '../Song/Song'; // Import the Song component from its new location
import songsData from '../../data/songs'; // Import songs.json from its new location

const Playlist = () => {
    return (
      <div className="playlist bg-lightGray text-white p-4 rounded-lg shadow-lg">
        <h2 className="text-2xl font-bold mb-4">
          <span className="bg-teal px-2 py-1 rounded-lg">My</span> Daily Playlist
        </h2>
        <ul>
          {songsData.map((song, index) => (
            <Song
              key={index}
              title={song.title}
              artist={song.artist}
              duration={song.duration}
              className="mb-4"
            />
          ))}
        </ul>
      </div>
    );
  };

export default Playlist;
